import { Link } from "react-router-dom";


function BlogItem(props) {
    return (
        <div>
            <img src={props.img} alt={props.name}></img>
            <p>{props.name}</p>
            <Link to={`/blogdetails/${props.pageNumber}`}>Read More</Link>
        </div >
    );
}

export default BlogItem;
